import React from 'react'

const Rating = ({ value, text, color }) => {
  let ans = Math.floor(value / 1)
  let rem = value % 1
  let element = []
  let cnt = 0
  for (let i = 0; i < ans; i++) {
    cnt += 1
    element.push(
      <span>
        <i style={{ color }} className='fas fa-star'></i>
      </span>
    )
  }
  if (rem !== 0) {
    cnt += 1
    element.push(
      <span>
        <i style={{ color }} className='fas fa-star-half-alt'></i>
      </span>
    )
  }
  rem = 5 - cnt
  for (let i = 0; i < rem; i++) {
    element.push(
      <span>
        <i style={{ color }} className='far fa-star'></i>
      </span>
    )
  }

  return (
    <div className='rating'>
      {element}
      <span>{text ? text : ' '}</span>
    </div>
  )
}

Rating.defaultProps = { color: '#f8e825' }
Rating.protoTypes = {
  value: PropTypes.number.isRequired,
}
export default Rating
